import React, { useEffect, useRef, useState } from 'react';
import { useReactToPrint } from 'react-to-print';
import { Autocomplete, Button, Grid, MenuItem, Select, TextField, Typography } from '@mui/material';
import { url } from '../../Constants';
import { CFormInput, CTable, CTableBody, CTableDataCell, CTableFoot, CTableHead, CTableHeaderCell, CTableRow } from '@coreui/react';

const Fetchaccountingdetails = () => {

  const [searchbyvalue, setsearchbyvalue] = useState();
  const [offeringtype, setofferingtype] = useState();
  const [fromdate, setfromdate] = useState();
  const [namelist, setnamelist] = useState([]);
  const [name, setname] = useState();
  const [todate, settodate] = useState();
  const [searchbynameobj, setsearchbynameobj] = useState([]);
  const [searchbydateobj, setsearchbydateobj] = useState([]);
  const [objoftotals, setsobjoftotals] = useState([]);
  const [display1, setdisplay1] = useState('none');
  const [display2, setdisplay2] = useState('none');
  const [display3, setdisplay3] = useState('none');
  const [namearray, setnamearray] = useState([]);
  const printref = useRef();



  let flag = 0;

  let count = 0;

  const submitbyname = () => {
    if (fromdate.length !== 0 && todate.length !== 0) {
      fetch(`${url}/jehovanissi/api/accounting-submitbyname.php`, {
        method: 'POST',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json',

        },
        body: JSON.stringify({
          name: name,
          fromdate: fromdate,
          todate: todate

        })
      })
        .then(res => res.json())
        .then((result) => {
          if (result !== "No matches found on Record") {
            setsearchbynameobj(result);
            setdisplay1("block");

          } else {
            alert(result);
            setdisplay1("none");

          }
        }).catch((error) => {
          console.error(error);
        });

    }


    else {
      alert("Input all required");
    }
  }

  const submitbydate = () => {
    if (fromdate.length !== 0 && todate.length !== 0) {
      fetch(`${url}/jehovanissi/api/accounting-submitbydate.php`, {
        method: 'POST',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json',

        },
        body: JSON.stringify({

          fromdate: fromdate,
          todate: todate

        })
      })
        .then(res => res.json())
        .then((result) => {
          if (result !== "No matches found on Record") {
            setsearchbydateobj(result);
            setdisplay2("block");
            result.map((l) => {
              setnamearray(cp => [...cp, l.Name]);
            })

          } else {
            alert(result);
            setdisplay2("none");

          }
        }).catch((error) => {
          console.error(error);
